/*
p, h1, h2, h3, h4, h5, h6, pre, .cell.text, .markdown, .main-content, .notebook-content, .add-cell, .cell, .text, .formview, .formview-title {
    color: #ccc;
    background: #000;
}
*/

p, h1, h2, h3, h4, h5, h6, .cell.text, .markdown, .main-content, .notebook-content, .add-cell, .cell, .text, .formview, .formview-title {
    color: #ccc;
    background: #000;
}


.notebook-content {
    color: #ccc;
    background: #000;
    border: 1px solid #444;
}

.goog-menubar .goog-menu-button {
    border: 1px solid #444;
}

#header, #header-doc-toolbar, .doc-name, .goog-menu-button, #top-menubar, #top-toolbar, 
.goog-menu-button-caption, .goog-inline-block, div.goog-menu-button.goog-inline-block, 
.goog-menu-button-open, paper-button {
    color: #ccc!important;
    background: #000!important;
}   

span.CodeMirror-selectedtext {
    background: #44f;
}

.goog-menu, .goog-menuitem, .goog-menuseparator.goog-menuitem-disabled, 
.goog-menuitem-content, .editor.flex {
    color: #ddd;
    background: #444;
    border-color: #666; 
}

.goog-menuitem-accel {
    color: #888;
    background: #444;
}

.paper-material-0[elevation="2"] {
    box-shadow: 1px 1px 5px 3px #888b /* , 0 3px 3px 0  #8888, 0 3px 3px -1px  #8888; */
}

.add-cell {
    background: #8880! important;    
}

.CodeMirror-code {
    color: #ccc!important;
    background: #222;
}

.CodeMirror pre, 
.CodeMirror.cm-s-default.CodeMirror-simplescroll {
    color: #ccc;
    background: #222;
}

pre.CodeMirror-line {
    color: #ff0;    
}

body {
    color: #fff;
    background: #000;
    --code-cell-background: #222;    /* code cell outer frame and non-active code cell left gutter */
}

.CodeMirror-matchingbracket {
    color: #8ff!important;
}

.CodeMirror-activeline pre{
    background: #333;
}

.CodeMirror-cursor {
    border-left: 1px solid #0f0;
}

/* gutters */

.code.output-selected .output-info  {
    background: #555;
}

.cell-gutter{
    background: #222;
}

.code.focused.output-selected .cell-gutter {
    color: #ccc;
    background: #222;
}

.code.focused .cell-gutter {
    color: #ccc;
    background: #555;
}

.output-info {
    color: #ccc;
    background: #000;
}

.code.focused .cell-execution-indicator iron-icon {
    color: #ccc;
}

/* markdown */

.text.edit .cm-header {
    color: #8ff;
}

.text.edit .markdown,
.text.edit .CodeMirror,
.text.edit .cm-variable-2,
.text.edit .cm-comment,
.text.edit .cm-quote {
    color: #f88;
    font-family: 'Roboto', 'Noto', sans-serif;
    font-size: 14px
}
.text.edit .markdown a,
.text.edit .cm-link,
.text.edit .cm-url,
.text.edit .cm-header.cm-link,
.text.edit .cm-header.cm-url {
    color: #88f
}

.text.edit .CodeMirror .markdown-mathjax {
    color: #f80;
    font-family: Georgia, "Times New Roman", Times, serif;
    font-style: italic;
    font-weight: 400;
    letter-spacing: 1px
}

.cm-s-default .cm-keyword {
    color: #fff;
    font-weight: bold;
}
.cm-s-default .cm-atom {
    color: #f0f
}
.cm-s-default .cm-number {
    color: #f00;
    font-weight: bold;
}
.cm-s-default .cm-def {
    color: #0ff
}
.cm-s-default .cm-variable,
.cm-s-default .cm-property{
    color: #bbb;
}

.cm-s-default .cm-punctuation,
.cm-s-default .cm-operator {
    color: #ff0;
    font-weight: bold;
}

.cm-s-default .cm-variable-2 {
    color: #88f
}
.cm-s-default .cm-variable-3,
.cm-s-default .cm-type {
    color: #085
}
.cm-s-default .cm-comment {
    color: #0f0;    
/*    font-weight: bold;    */
}
.cm-s-default .cm-string {
    color: #f00;
    font-weight: bold;    
}
.cm-s-default .cm-string-2 {
    color: #8f0
}
.cm-s-default .cm-meta {
    color: #f80
}
.cm-s-default .cm-qualifier {
    color: #555
}
.cm-s-default .cm-builtin {
    color: #fff
}
.cm-s-default .cm-bracket {
    color: #997
}
.cm-s-default .cm-tag {
    color: #fff;
    font-weight: bold;    
}
.cm-s-default .cm-attribute {
    color: #00c
}
.cm-s-default .cm-hr {
    color: #999
}

a, .cm-s-default .cm-link {
    color: #88f
}
.cm-s-default .cm-error {
    color: #000;
    background: #f00;
}
.cm-invalidchar {
    color: #000;
    background: #f00;
}

.content-area, .error-message, .scrollable, .buttons {
    background-color: #000;
    color: #ccc;
}

.paper-button {
    color: #ccc;
    opacity: 0.3;
    background-color: #888;
    border: 2px;
    border-color: #fff;
}
.iron-overlay-backdrop-0 {
    background-color: #888;
}

.iron-overlay-backdrop-0.opened {
    opacity: 0.5;
}
